INSERT INTO ceds6sc_rdx.Ref_Naep_Math_Complexity_Level( Ref_Naep_Math_Complexity_Level_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Low complexity', 'Low_Complexity', 'This category relies heavily on the recall and recognition of previously learned concepts and principles. Items typically specify what the student is to do, which is often to carry out some procedure that can be performed mechanically. It is not left to the student to come up with an original method or solution.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Naep_Math_Complexity_Level( Ref_Naep_Math_Complexity_Level_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Moderate complexity', 'Moderate_Complexity', 'Items in the moderate-complexity category involve more flexibility of thinking and choice among alternatives than do those in the low-complexity category. They require a response that goes beyond the habitual, is not specified, and ordinarily has more than a single step. The student is expected to decide what to do, using informal methods of reasoning and problem-solving strategies, and to bring together skill and knowledge from various domains.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Naep_Math_Complexity_Level( Ref_Naep_Math_Complexity_Level_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'High complexity', 'High_Complexity', 'High-complexity items make heavy demands on students, who must engage in more abstract reasoning, planning, analysis, judgment, and creative thought. A satisfactory response to the item requires that the student think in an abstract and sophisticated way.', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.Ref_Naep_Math_Complexity_Level( Ref_Naep_Math_Complexity_Level_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Low complexity', 'Low_Complexity', 'This category relies heavily on the recall and recognition of previously learned concepts and principles. Items typically specify what the student is to do, which is often to carry out some procedure that can be performed mechanically. It is not left to the student to come up with an original method or solution.', null, 1.00 ); 
