INSERT INTO ceds6sc_rdx.ref_k12_responsibility_type( Ref_K12_Responsibility_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Accountability', 'Accountability', 'The role/relationship type assigned to an organization, institution, or agency responsible for student learning under Federal ESEA and State accountability plans.  (e.g. for AYP reporting)', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.ref_k12_responsibility_type( Ref_K12_Responsibility_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Attendance', 'Attendance', 'The role/relationship assigned to an organization, institution, or agency operating the physical or virtual site in which delivery of educational services take place.', null, 2.00 ); 
INSERT INTO ceds6sc_rdx.ref_k12_responsibility_type( Ref_K12_Responsibility_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Funding', 'Funding', 'The role/relationship assigned to an organization, institution, or agency responsible for funding related to a student enrollment.  ', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.ref_k12_responsibility_type( Ref_K12_Responsibility_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Graduation', 'Graduation', 'The role/relationship assigned to an organization, institution, or agency responsible for issuing/awarding diplomas.  (e.g. for graduation-rate reporting)', null, 4.00 ); 
INSERT INTO ceds6sc_rdx.ref_k12_responsibility_type( Ref_K12_Responsibility_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Individualized education program (IEP)', 'Individualized_Education_Program', 'The role/relationship type assigned to an organization, institution, or agency responsible for the enrolled student?s IEP,  a written instructional plan for students with disabilities designated as special education students under the Individuals with Disabilities Education Act (IDEA-Part B) which includes: 1) a statement of present levels of educational performance of a child; 2) a statement of annual goals including short-term instructional objectives; 3) a statement of specific education and related services to be provided and the extent to which the child will be able to participate in regular educational programs; 4) a projected date for initiation and anticipated duration of services; and 5) appropriate objectives, criteria and evaluation procedures and schedules for determining, on at least an annual basis, whether instructional objectives are being achieved.', null, 5.00 ); 
INSERT INTO ceds6sc_rdx.ref_k12_responsibility_type( Ref_K12_Responsibility_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Transportation', 'Transportation', 'The role/relationship type assigned to an organization, institution, or agency responsible for transporting the student to the physical location of the school or facility in which educational services are delivered.', null, 6.00 ); 
