INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Administrative Support Staff', 'Administrative_Support_Staff', 'Staff members who provide direct support to administrators, business office support, data processing, or support of the teaching and administrative duties of the office of the principal or department chairpersons, including clerical staff and secretaries.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Administrators', 'Administrators', 'Executive officers or managers of education agencies or institutions, including superintendents, deputies, and assistant superintendents; other persons with district-wide responsibilities: e.g., business managers, administrative assistants, and professional instructional support staff.   In addition, staff members whose activities are concerned with directing and managing the operation of a particular school including principals, assistant principals, and other assistants; persons who supervise school operations, assign duties to staff members, supervise and maintain the records of the school, and coordinate school instructional activities with those of the education agency, including department chairpersons.', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'All Other Support Staff ', 'All_Other_Support_Staff', 'Support staff not reported in instructional or student support. Other support staff includes employees such as data processing, health, plant and equipment maintenance, bus drivers, security, and food service workers.', null, 5.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Behavioral Specialists', 'Behavioral_Specialists', 'Behavioral Specialists', null, 7.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Early Leaning Assistant Teachers', 'EL_Assistant_Teachers', 'Assistant Teachers of general level instruction and/or services delivery classified by state and local practice from birth to Kindergarten.', null, 9.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Early Learning Teachers', 'EL_Teachers', 'Teachers of general level instruction and/or service delivery classified by state and local practice from birth to Kindergarten.', null, 10.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Elementary Teachers', 'Elementary_Teachers', 'Teachers of general level instruction classified by state and local practice as elementary and composed of any span of grades not above grade 8.', null, 11.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Family Service Workers', 'Family_Service_Workers', 'Professional staff members assigned specific duties related to staff providing in-home and other services (including needs assessment, development of service plans, family advocacy, and coordination of service delivery) to families of children participating in early care and education programs.', null, 15.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Health Specialists', 'Health_Specialists', 'Professional staff members or supervisors assigned specific duties related to providing any Health services that are not specific to mental health.', null, 17.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Home Visitors', 'Home_Visitors', 'Professional staff members assigned specific duties related to visiting a child or pregnant woman''s home for the purpose of assisting parents in fostering the growth and development of their child.', null, 19.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Instructional Coordinators', 'Instructional_Coordinators', 'Staff supervising instructional programs including  professional staff members or supervisors in an early learning program assigned specific duties related to instruction ,  or supervisors at a school district or sub-district level including curriculum coordinators or supervisors; in-service training staff; Title I supervisors; home economics supervisors; educational television staff; coordinators and supervisors of audiovisual services; and staff engaged in development of computer-assisted instruction.', null, 21.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Kindergarten Teachers', 'Kindergarten_Teachers', 'Teachers of a group or class that is part of a public school program and is taught during the year preceding the first grade.', null, 23.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Librarians/Media Specialists', 'Library_Media_Specialists', 'A professional staff member or supervisor assigned specific duties and school time for professional library and media service activities. Activities include: selecting, acquiring, preparing, cataloging, and circulating books and other printed materials; planning the use of library and media services by students, teachers and other members of the instructional staff; and guiding individuals in their use of media services and library materials, (whether maintained separately or as part of an instructional materials center).', null, 25.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Library/Media Support Staff', 'Library_Media_Support_Staff', 'Staff members who render other library or media services, such as preparing, caring for, and making available to members of the instructional staff the equipment, films, filmstrips, transparencies, tapes, TV programs, and similar materials (whether maintained separately as part of an instructional materials center).', null, 27.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Mental Health Specialists', 'Mental_Health_Specialists', 'Professional staff members or supervisors assigned specific duties related to Mental Health.', null, 29.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Nutrition Specialists', 'Nutrition_Specialists', 'Professional staff members or supervisors assigned specific duties related to Nutrition.', null, 31.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'Paraprofessionals', 'Paraprofessionals', 'Paraprofessionals are employees who provide instructional support, including those who: (1) provide one-on-one tutoring if such tutoring is scheduled at a time when a student would not otherwise receive instruction from a teacher, (2) assist with classroom management, such as organizing instructional and other materials, (3) provide instructional assistance in a computer laboratory, (4) conduct parental involvement activities, (5) provide support in a library or media center, (6) act as a translator, or (7) provide instructional support services under the direct supervision of a teacher.', null, 35.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'Part C Early Interventionists', 'Part_C_Early_Interventionists', 'Professional staff members employed to provide early intervention services to infants and toddlers with disabilities or at-risk of experiencing a substantial developmental delay as defined by Part C of the  Individuals with Disabilities Education Act (IDEA): The Early Intervention Program for Infants and Toddlers with Disabilities.', null, 37.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Part C Service Coordinators', 'Part_C_Service_Coordinators', 'Professional staff members employed to coordinate early intervention services to infants and toddlers with disabilities or at-risk of experiencing a substantial developmental delay  as defined by Part C of the  Individuals with Disabilities Education Act (IDEA): The Early Intervention Program for Infants and Toddlers with Disabilities.', null, 39.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 20, 'School Counselors', 'School_Counselors', 'Professional staff members assigned specific duties and school time for any of the following activities: counseling with students and parents, consulting with other staff members on learning problems, evaluating student abilities, assisting students in making education and career choices, assisting students in personal and social development, providing referral assistance, and/or working with other staff members in planning and conducting guidance programs for students. School counselors may be reported by elementary and secondary level when that information is available.', null, 41.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 21, 'Secondary Teachers', 'Secondary_Teachers', 'Teachers of a general level of instruction classified by state and local practice as secondary and composed of any span of grades beginning with the next grade following the elementary grades and ending with or below grade 12.', null, 43.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 22, 'Social Workers', 'Social_Workers', 'Social workers assist people by helping them cope with and solve issues in their everyday lives, such as family and personal problems and dealing with relationships. ', null, 45.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 23, 'Special Education Teachers', 'Special_Education_Teachers', 'Special Education teachers include teachers employed to provide special education services to children with disabilities, including preschool teachers, itinerant/consulting teachers, and home/hospital teachers. This count should include teachers of children with disabilities in separate schools and facilities. ', null, 47.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 24, 'Special Needs Specialists', 'Special_Needs_Specialists', 'Professional staff members or supervisors assigned specific duties related to special needs learners.', null, 49.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 25, 'Student Support Services Staff', 'Student_Support_Services_Staff', 'Professional and supervisory staff providing non-instructional services to students including attendance officers; staff providing health, psychology, speech pathology, audiology, or social services; and supervisors of the preceding staff and of health, transportation, and food service workers.', null, 51.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 26, 'Ungraded Teachers', 'Ungraded_Teachers', 'Teachers of classes or programs to which students are assigned without standard grade designation.', null, 53.00 ); 
