INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 44, 'Paraprofessionals', 'Paraprofessionals', 'Paraprofessionals are employees who provide instructional support, including those who: (1) provide one-on-one tutoring if such tutoring is scheduled at a time when a student would not otherwise receive instruction from a teacher, (2) assist with classroom management, such as organizing instructional and other materials, (3) provide instructional assistance in a computer laboratory, (4) conduct parental involvement activities, (5) provide support in a library or media center, (6) act as a translator, or (7) provide instructional support services under the direct supervision of a teacher.', null, 35.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 45, 'Part C Early Interventionists', 'Part_C_Early_Interventionists', 'Professional staff members employed to provide early intervention services to infants and toddlers with disabilities or at-risk of experiencing a substantial developmental delay as defined by Part C of the  Individuals with Disabilities Education Act (IDEA): The Early Intervention Program for Infants and Toddlers with Disabilities.', null, 37.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 46, 'Part C Service Coordinators', 'Part_C_Service_Coordinators', 'Professional staff members employed to coordinate early intervention services to infants and toddlers with disabilities or at-risk of experiencing a substantial developmental delay  as defined by Part C of the  Individuals with Disabilities Education Act (IDEA): The Early Intervention Program for Infants and Toddlers with Disabilities.', null, 39.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 47, 'School Counselors', 'School_Counselors', 'Professional staff members assigned specific duties and school time for any of the following activities: counseling with students and parents, consulting with other staff members on learning problems, evaluating student abilities, assisting students in making education and career choices, assisting students in personal and social development, providing referral assistance, and/or working with other staff members in planning and conducting guidance programs for students. School counselors may be reported by elementary and secondary level when that information is available.', null, 41.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 48, 'Secondary Teachers', 'Secondary_Teachers', 'Teachers of a general level of instruction classified by state and local practice as secondary and composed of any span of grades beginning with the next grade following the elementary grades and ending with or below grade 12.', null, 43.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 49, 'Social Workers', 'Social_Workers', 'Social workers assist people by helping them cope with and solve issues in their everyday lives, such as family and personal problems and dealing with relationships. ', null, 45.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 50, 'Special Education Teachers', 'Special_Education_Teachers', 'Special Education teachers include teachers employed to provide special education services to children with disabilities, including preschool teachers, itinerant/consulting teachers, and home/hospital teachers. This count should include teachers of children with disabilities in separate schools and facilities. ', null, 47.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 51, 'Special Needs Specialists', 'Special_Needs_Specialists', 'Professional staff members or supervisors assigned specific duties related to special needs learners.', null, 49.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 52, 'Student Support Services Staff', 'Student_Support_Services_Staff', 'Professional and supervisory staff providing non-instructional services to students including attendance officers; staff providing health, psychology, speech pathology, audiology, or social services; and supervisors of the preceding staff and of health, transportation, and food service workers.', null, 51.00 ); 
INSERT INTO ceds6sc_rdx.ref_pd_activity_target_audience( Ref_PD_Activity_Target_Audience_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 53, 'Ungraded Teachers', 'Ungraded_Teachers', 'Teachers of classes or programs to which students are assigned without standard grade designation.', null, 53.00 ); 
