INSERT INTO ceds6sc_rdx.ref_ps_exit_or_withdrawal_type( Ref_PS_Exit_Or_Withdrawal_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Withdrawn', 'Withdrawn', 'A student enrolled in a postsecondary institution who has withdrawn, dropped out, failed to re-enroll or been terminated, expelled or dismissed by the institution is considered withdrawn.', null, 1.00 ); 
INSERT INTO ceds6sc_rdx.ref_ps_exit_or_withdrawal_type( Ref_PS_Exit_Or_Withdrawal_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Graduated', 'Graduated', 'A student who was enrolled in an eligible postsecondary institution and completed the requirements for graduation or the program of study in which he/she was enrolled is considered graduated.', null, 3.00 ); 
INSERT INTO ceds6sc_rdx.ref_ps_exit_or_withdrawal_type( Ref_PS_Exit_Or_Withdrawal_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Approved Leave of Absence', 'Approved_Leave_Of_Absence', 'A student who is enrolled in an eligible postsecondary institution and has met the requirements for an approved student loan leave of absence and, therefore, is not required to attend classes for a specified period of time. For purposes of Title IV, HEA program loan borrower, an institution does not have to treat a leave of absence as a withdrawal if it is an approved leave of absence. An approved student loan leave of absence must not exceed 180 days in any 12-month-period. The number of days in a leave of absence is counted beginning with the first day of the student?s initial leave of absence in a 12-month period. If a student does not resume attendance at the institution at or before the end of a leave of absence, the institution must treat the student as a withdrawal in accordance with CFR 668.22(d).', null, 5.00 ); 
INSERT INTO ceds6sc_rdx.ref_ps_exit_or_withdrawal_type( Ref_PS_Exit_Or_Withdrawal_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Deceased', 'Deceased', 'Student is deceased.', null, 7.00 ); 
INSERT INTO ceds6sc_rdx.ref_ps_exit_or_withdrawal_type( Ref_PS_Exit_Or_Withdrawal_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Unknown', 'Unknown', 'Student''s exit circumstances are unknown.', null, 9.00 ); 
